import Layout from "../components/Layout";
const Hireme = () => (
  <Layout title="Hire me  ">
    <h1>Hire me</h1>
    <p>
      You can mail me at <a href="mailto:kk@gmail.com"> gmail</a>
    </p>
  </Layout>
);

export default Hireme;
